import React from 'react'
import './login.css'

/* import { toast } from 'react-toastify'; */
import { useNavigate } from 'react-router-dom';
const Login = () => {
    state={
        email:'',
        password:''
    }
    handleSubmit=(e)=>{
        const{name,value}=e.target
        this.setState({[name]:value})
    }
    let navigate = useNavigate();

    /* function paymentSuccess() {
        toast.success('Loggined Successfully', {
            position: "top-center",
            autoClose: 5000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
        });



    } */
    return (
        <div className='logindiv'>
            <h1 className='text-center'>LOGIN</h1>
            <div className="loginForm">

                <input className='name' type="email" placeholder=' Enter your Mail' /><br /><br />
                <input  className='name'type="password" placeholder='password' />
                <br />
                <br />
                <button className="logInBtn" onSubmit={this.handleSubmit}>Submit</button>
                
            </div>
        </div>
    )
}

export default Login;
